      <Circle cx={80} cy={168} r={32} opacity={0.2} fill={props.color} />
      <Circle cx={80} cy={64} r={32} opacity={0.2} fill={props.color} />
      <Circle cx={176} cy={168} r={32} opacity={0.2} fill={props.color} />
